import React from 'react';
import { Menu } from '../ui/components/Menu';
import Fluxograma from '../ui/components/Fluxograma';

const ProcessFlow: React.FC = () => {

  return (
    <div className='flex'>
      <Menu />

      <div className='w-80vw h-70vh mr-auto'>
        <Fluxograma />
      </div>
    </div>
  );
};

export default ProcessFlow;
